import PhotoCard from "../components/PhotoCard";
import { map } from "../static/photos";

const Content = () => {
  return (
    <Grid container spacing={4}>
      <Grid item xs={12} sm={4}>
        <PhotoCard picture={map[0]} />
      </Grid>
    </Grid>
  );
};
export default Content;
